import React from 'react';
import { Navbar, Nav, Container, Button, Card, ListGroup, Table } from 'react-bootstrap';
import { FaHeartbeat, FaMobileAlt, FaMoneyBillWave } from 'react-icons/fa';
import { Link } from 'react-router-dom';

// Inline CSS
const styles = {
  body: {
    fontFamily: "'Arial', sans-serif",
    lineHeight: 1.6,
    backgroundColor: '#f4f4f9',
    color: '#333',
    padding: '0 1rem',
  },
  nav: {
    backgroundColor: '#6a82fb',
    width: '130%',
    marginLeft: '-1rem',
    marginBottom: '1rem',
  },
  navLink: {
    color: '#fff',
    marginRight: '1rem',
  },
  section: {
    padding: '4rem 2rem',
    margin: '0 auto',
    maxWidth: '1200px',
    borderRadius: '8px',
    backgroundColor: '#fff',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    textAlign: 'center',
    marginBottom: '2rem',
  },
  sectionTitle: {
    marginBottom: '1.5rem',
    color: '#333',
  },
  button: {
    marginTop: '2rem',
    padding: '0.75rem 1.5rem',
    fontSize: '1.25rem',
    backgroundColor: '#ff4081',
    borderColor: '#ff4081',
  },
  listGroupItem: {
    display: 'flex',
    alignItems: 'center',
    fontSize: '1rem',
    padding: '1rem',
    border: 'none',
    backgroundColor: '#f4f4f9',
  },
  icon: {
    marginRight: '1rem',
    fontSize: '1.5rem',
    color: '#6a82fb',
  },
};

const ProductPage = () => {
  return (
    <div style={styles.body}>
      {/* Navigation Bar */}
      <Navbar expand="lg" style={styles.nav}>
        <Container fluid>
          <Navbar.Brand as={Link} to="/" style={{ color: '#fff' }}>sensAIra</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ml-auto">
              <Nav.Link as={Link} to="/" style={styles.navLink}>Home</Nav.Link>
              <Nav.Link as={Link} to="/product" style={styles.navLink}>Product</Nav.Link>
              <Nav.Link as={Link} to="/contact" style={styles.navLink}>Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      {/* Product Details Section */}
      <section className="text-center py-5" style={styles.section}>
        <h2 className="font-weight-bold" style={styles.sectionTitle}>Product Details</h2>
        <p><strong>Introducing sensAIra:</strong> An AI-powered platform that helps predict and monitor health conditions like hypertension and COPD using data from our wearable wristband.</p>
        <Button variant="primary" style={styles.button}>Buy Now</Button>
      </section>

      {/* Vision, Mission, and Problem Statement Section */}
      <section style={styles.section}>
        <h2 style={styles.sectionTitle}>Our Vision</h2>
        <p>To improve the quality of life for people.</p>
        <h2 style={styles.sectionTitle}>Our Mission</h2>
        <p>We aim to use AI and remote monitoring technologies to provide personalized healthcare for the elderly, ensuring early warnings, continuous monitoring, and making healthcare accessible and effective.</p>
        <h2 style={styles.sectionTitle}>Problem Statement</h2>
        <p>The world's aging population is growing rapidly, but healthcare services are often inaccessible, costly, or inefficient for the elderly. 70% of seniors have at least one chronic condition, and 40% have two or more.</p>
        <h2 style={styles.sectionTitle}>Our Solution: sensAIra</h2>
        <p>sensAIra will be a cutting-edge platform that leverages AI to predict COPD exacerbations and hypertension spikes by using data gathered from our wearable wristband. By focusing on prevention and early detection, it reduces the need for costly hospital visits, bridging healthcare gaps.</p>
      </section>

      {/* Features Section */}
      <section className="features" style={styles.section}>
        <h2 style={styles.sectionTitle}>Key Features</h2>
        <div className="row">
          {features.map((feature, idx) => (
            <div className="col-md-4 mb-4" key={idx}>
              <Card className="shadow-lg" style={styles.card}>
                <Card.Body style={styles.cardBody}>
                  <feature.icon className="text-primary mb-3" style={{ fontSize: '2.5rem', color: '#6a82fb' }} />
                  <div>
                    <Card.Title style={styles.cardTitle}>{feature.title}</Card.Title>
                    <Card.Text style={styles.cardText}>{feature.desc}</Card.Text>
                  </div>
                </Card.Body>
              </Card>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
};

export default ProductPage;
